import HeaderImg from "../../Components/images/header.jpg"
import "./header.css"
const Header = () =>{

    return (
        <>
            {/* Header */
            <div className="header">
                <div className="img">
                    <div>
                        <img src="{HeaderImg}" alt=""/>
                    </div>
                </div>
            
            </div>
            }
        </>
    )
}

export default Header;
